92:\"— гранулированный строительный материал, используемый для теплоизоляции конструкций https://al-keram.ru/dostavka-keramzita-v-serpukhove.html\r\n  Невысокая цена и универсальные эксплуатационные характеристики позволяют керамзиту на равных конкурировать в своей нише с инновационными строительными материалами https://al-keram.ru/novosti/grafik-raboty-v-novogodnie-prazdniki.html\r\n  Основным критерием классификации керамзита считается размер его гранул (фракции) и насыпная плотность https://al-keram.ru/catalog-keramzita.html\r\n \r\nСама же поверхность материала будет плавиться под воздействием высокой температуры – так образуется отличная герметичная оболочка, которая обладает высокой прочностью и износоустойчивостью, а также устойчивостью к механическим повреждениям https://al-keram.ru/blog/keramzitobetonnye-bloki.html\r\n \r\n\r\nРезультат для мокрой стяжки в итоге получился примерно таким же, как и для сухой https://al-keram.ru/blog/uteplenie-keramzitom.html\r\n  Поэтому, для упрощения расчета количества керамзита на квадратный метр достаточно просто воспользоваться данными о высоте стяжки https://al-keram.ru/keramzit-s-dostavkoj-v-krasnogorsk.html\r\n \r\nДля утепления конструкции пола керамзит может использоваться двумя способами https://al-keram.ru/zakazat-keramzit-v-odintsovo.html\r\n  В первом варианте он замешивается в раствор для заливки стяжки https://al-keram.ru/kupit-keramzit-v-tule.html\r\n  Это существенно повышает прочностные и теплоизоляционные свойства образуемой поверхности https://al-keram.ru/dostavka-keramzita-v-khimki.html\r\n  Во втором случае засыпка керамзитом входит в состав пирога конструкции пола по грунту или по перекрытию https://al-keram.ru/contacts.html\r\n  В зависимости от способа применения, определяют какая фракция керамзита лучше для пола https://al-keram.ru/keramzit-s-dostavkoj-v-kaluge.html\";s:12:\"comment_type\";s:7:\"comment\";s:7:\"user_id\";i:0;s:7:\"user_ID\";i:0;s:17:\"comment_author_IP\";s:14:\"62.113.113.162\";s:13